The Shortcut (Robby D. Digital Playground / 2013)

On the way to high school reunion, Bibi Jones and gal pal Lilly Banks get stranded in the middle of nowhere when an old high school rival gives them dodgy directions. Their only oasis is a biker bar filled with wild characters. Hot and horny Christy Mack offers herself up to Ike Diesel in the middle of the bar. After an impromptu inking of Bibi would be tattoo artist Karlo Karrera bangs Bonnie Rotten. Bibi gets in the spirit of spontaneity and goes the deed with bar tender Johnny Sins. When the girls finally make it to the reunion, Bibi makes up for never hooking up with her old crush Xander Corvus and shows him a hardcore sexing. Lilly unleashes her wild side and gives math teacher Tommy Gunn some naughty lessons of her own!

Christy Mack, BiBi Jones, Lilly Banks, Tommy Gunn, Xander Corvus, Johnny Sins, Bonnie Rotten, Carlo Carrera

